import numpy as np
import pandas as pd
import nltk
import re
import tensorflow as tf
import matplotlib.pyplot as plt
import seaborn as sns
from nltk.corpus import stopwords
nltk.download('stopwords')
from tensorflow.keras.layers import Embedding
from tensorflow.keras.preprocessing.sequence import pad_sequences
from tensorflow.keras.models import Sequential
from tensorflow.keras.preprocessing.text import one_hot
from tensorflow.keras.layers import LSTM
from tensorflow.keras.layers import Dense
from nltk.stem.porter import PorterStemmer
from sklearn.model_selection import train_test_split
from sklearn.ensemble import ExtraTreesClassifier
from sklearn.metrics import classification_report



df=pd.read_csv('/content/drive/MyDrive/train.csv')

df.head()

df['title'] = df['title'].fillna('').apply(str)

X=df.drop('label',axis=1)

X

Y=df['label']

Y

X.shape

X.apply(str)

Y.shape

vocab_size=8000

headlines=X.copy()

headlines.title[0]

headlines.reset_index(inplace=True)

corpus= []
ps = PorterStemmer()
for i in range(len(headlines)):
    r = re.sub('[^a-zA-Z]',' ',headlines['title'][i])
    r = r.lower()
    r = r.split()
    r = " ".join(ps.stem(word) for word in r if word not in stopwords.words('english'))
    corpus.append(r)

corpus[0]

one_hot_repersentation=[one_hot(words,vocab_size) for words in corpus]

#embedding representaion

sent_length=25
embedded_rep=pad_sequences(one_hot_repersentation,padding='pre',maxlen=sent_length)

embedded_rep[0]

"""**MODEL BUILDING**"""

embedding_vec=35
model=Sequential()
model.add(Embedding(vocab_size,embedding_vec,input_length=sent_length))
model.add(LSTM(150))
model.add(Dense(1,activation='sigmoid'))
model.compile(loss='binary_crossentropy',optimizer='adam',metrics=['accuracy'])
model.summary()

len(embedded_rep),Y.shape

x_final=np.array(embedded_rep)
y_final=np.array(Y)

x_final.shape,y_final.shape

X_train, X_test, y_train, y_test = train_test_split(x_final, y_final, test_size=0.33, random_state=133)
mn= ExtraTreesClassifier() 
mn.fit(X_train,y_train)
y_pred = mn.predict(X_test)

print("Classification_report")
print()
print(classification_report(y_pred , y_test))

## accuracy is 0.89%

